// Credit: https://craftpix.net/freebies/free-game-icons-fantasy-mage-outfit-pack-7/
import TealRobesImg from './teal-robes.png';

const TealRobes = {
  name: 'Teal Robes',
  type: 'armor::body',
  effect: {
    mana: 70,
  },
  image: TealRobesImg,
  value: 100,
};

export default TealRobes;
